import React from 'react';
import styled from 'styled-components';

export const InputStyle=styled.input`
border-bottom: 1px solid #707070;
border-top: none;
border-left: none; 
border-right: none;
margin-right: 0;
width:100%;
`;
export const ImageStyle=styled.img`
position:absolute;
right:0;
top:0;
`
